 \"icon-line-help\", \"title\": \"网络和服务器服务\"}, {\"icon\": \"icon-line-help\", \"title\": \"3A级远程服务\"}], \"style\": \"one\", \"title\": \"<span>IT外包</span>服务\", \"background\": \"white\", \"description\": \"致力于让用户的IT更简单、更高效、更安全、更有价值\"}}, {\"key\": \"page/content/620716a9-ac51-4a1b-b168-3f244a52ff9a\", \"props\": {\"url\": \"\", \"icon\": \"icon-spa\", \"image\": \"https://www.linemore.com/images/hai.png\", \"style\": \"one\", \"title\": \"应急服务\", \"slogan\": \"随叫随到\", \"content\": [{\"icon\": \"icon-signal\", \"title\": \"专属服务团队提供服务\"}, {\"icon\": \"icon-sign-in-alt\", \"title\": \"人员稳定，拒绝陌生面孔服务\"}, {\"icon\": \"icon-sign\", \"title\": \"可灵活选择，5×8×2服务、5×8×4服务、7×24×2服务\"}, {\"icon\": \"icon-line-server\", \"title\": \"电脑台数在50台以内的企业\"}], \"urlText\": \"查看更多\", \"emphasis\": [\"5分钟响应\", \"2小时到场服务\", \"50-200元迟到按次罚款\"], \"background\": \"white\", \"description\": \"适用于电脑台数量50台以内的企业。这种服务方式优点是方便、灵活、随叫随到, 5分钟响应、2小时内到场服务。迟到，按次罚款。\"}}, {\"key\": \"page/content/0a1c4310-5d22-46ca-868a-f8e6bf90c871\", \"props\": {\"url\": \"\", \"icon\": \"icon-spa\", \"image\": \"https://www.linemore.com/images/hai2.png\", \"style\": \"two\", \"title\": \"驻场服务\", \"slogan\": \"随需而用\", \"content\": [{\"icon\": \"icon-line-send\", \"title\": \"专属服务团队提供服务\"}, {\"icon\": \"icon-line-send\", \"title\": \"方式灵活，提供每周5天、3天、2天或1天的固定工程师，按照客户作息时间提供常驻服务\"}, {\"icon\": \"icon-line-send\", \"title\": \"\\t电脑规模50台以上或IT工作量集中的企业\"}], \"urlText\": \"查看更多\", \"emphasis\": [\"稳定\", \"经验丰富\", \" 服务+巡检\", \"全方位分析\"], \"background\": \"background\", \"description\": \"适用于电脑数量50台以上，或对IT依赖性比较高，或IT工作量比较集中的企业。我们的固定工程师可以每周5天、3天、2天、1天按照客户作息时间常驻服务。\", \"hideBottomLine\": false}}, {\"key\": \"page/content/7aa2cdb0-b9c1-44c9-8e90-c3dd5d72423b\", \"props\": {\"url\": \"\", \"icon\": \"icon-spa\", \"image\": \"https://www.linemore.com/images/hai3.png\", \"style\": \"one\", \"title\": \"网络和服务器服务\", \"slogan\": \"主动预防\", \"content\": [{\"icon\": \"icon-line-stop-circle\", \"title\": \"专属服务团队提供服务\"}, {\"icon\": \"icon-line-thermometer\", \"title\": \"专业团队提供核心服务器、网络设备、安全系统的咨询、巡检和运维服务\"}, {\"icon\": \"icon-line-star\", \"title\": \"方式灵活，定期工程师现场巡检\"}], \"urlText\": \"查看更多\", \"emphasis\": [\"合理规划\", \"安全性\", \"稳定性\"], \"background\": \"background\", \"description\": \"我们的团队提供核心服务器、网络设备、系统安全的咨询、巡检和运维等“一站式”服务。\", \"hideBottomLine\": false}}, {\"key\": \"page/content/2f9b913c-4b36-4392-91e2-10aea831912b\", \"props\": {\"url\": \"\", \"icon\": \"icon-window\", \"image\": \"https://www.linemore.com/images/hai4.png\", \"style\": \"two\", \"title\": \"3A级远程服务\", \"slogan\": \"时刻在线\", \"content\": [{\"icon\": \"icon-email2\", \"title\": \"时刻在线、5分钟响应\"}, {\"icon\": \"icon-users1\", \"title\": \"远程服务次数不限次，按需上门\"}, {\"icon\": \"icon-share1\", \"title\": \"专属服务团队，精准定位问题\"}, {\"icon\": \"icon-paperclip1\", \"title\": \"标准化服务流程，保证服务质量\"}], \"urlText\": \"查看更多\", \"emphasis\": [\"快速\", \"安全\", \"稳定\"], \"background\": \"background\", \"description\": \"此服务适用于用户的电脑数量10台内或者移动办公人员多，地域分散或需要支持的次数少，响应要求却很高的企业。\", \"hideBottomLine\": true}}, {\"key\": \"page/content/588ddf04-708d-4304-9c82-0bf079da319f\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"产品选型\", \"urlText\": \"查看更多\", \"description\": \"参照您的需求，我们从海量的IT产品中为您挑选具有较高性价比的采购方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务流程\", \"urlText\": \"查看更多\", \"description\": \"严格标准化的流程，确保您能可以从蓝盟获得具有竞争力的采购服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"互升优势\", \"urlText\": \"查看更多\", \"description\": \"选型、支付、报修和保外服务，处处体现着互升的用心服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"品牌合作\", \"urlText\": \"查看更多\", \"description\": \"覆盖中小企业需求的全品类IT产品合作渠道。\"}], \"title\": \"IT采购\", \"number\": 4, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/images/IT.png\", \"subtitle\": \"CENTRALIZED IT PROCUREMENT\", \"background\": \"grey\", \"description\": \"<ul class=\\\"servcriul por\\\">                     <li>您可能面临的问题：</li>                     <li>采购需求零散，品类不多，涉及面广，选型咨询难！获得多供应商支持的难度大，成本高！多方采购导致单位成本升高，企业自身的议价难度大！</li>                 </ul>\"}}, {\"key\": \"page/content/8d4b148f-7d67-42d5-a6af-8c42dffee40f\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"综合布线\", \"urlText\": \"查看更多\", \"description\": \"综合布线 在新办公室装修、老办公室机房整理时，您需要专业团队提供定制化的方案、实惠的价格及标准化施工，蓝盟帮您全部搞定。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"机房建设\", \"urlText\": \"查看更多\", \"description\": \"蓝盟团队集建筑、电气、机电安装、网络构建等多个专业技术于一体，拥有丰富的工程实施和管理经验。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"门禁考勤\", \"urlText\": \"查看更多\", \"description\": \"门禁考勤系统可以提供人员进出、授权、查询、统计和防盗报警保安等功能，也可作为人事管理、考勤管理工具，是现代企业必备的IT系统。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"防盗报警系统\", \"urlText\": \"查看更多\", \"description\": \"设备一般分为：前端探测器，报警控制器。报警控制器是一台主机（如电脑的主机一样）\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"视频监控\", \"urlText\": \"查看更多\", \"description\": \"聚集了十余年行业从业经验的方案设计专家，为您量身打造精准、专业、智能的监控解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"电话交换机\", \"urlText\": \"查看更多\", \"description\": \"根据客户的业务特点，蓝盟团队为您提供专业的PBX和VOIP电话解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"多媒体会议室\", \"urlText\": \"查看更多\", \"description\": \"多媒体会议室集成了语音会议、视频会议、显示、广播、环境控制、电子白板、预约及会议系统，需要专业团队提供方案规划、设计、实施和维护。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"视频会议\", \"urlText\": \"查看更多\", \"description\": \"软件或硬件的方式，实现两个或两个以上不同地点的沟通需求，蓝盟已经为数百家企业实施了视频会议系统。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"一卡通\", \"urlText\": \"查看更多\", \"description\": \"可在同一张智能卡上实现、门禁、考勤、消费、巡更、访客管理、电梯控制等综合管理功能。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"拼接屏\", \"urlText\": \"查看更多\", \"description\": \"拼接屏是一个完整的液晶拼接显示单元，根据不同使用需求，实现单屏单独显示、任意组合显示、全屏液晶拼接、竖屏显示等不同内容展示需求。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"电话会议\", \"urlText\": \"查看更多\", \"description\": \"软件或硬件的方式，实现两个或两个以上不同地点的沟通需求，蓝盟已经为数百家企业实施了电话会议系统。\"}], \"title\": \"弱电工程\", \"number\": 6, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/images/rdgc.png\", \"subtitle\": \"WEAK CURRENT ENGINEERING\", \"background\": \"white\", \"description\": \"弱电系统是企业IT系统的基础