查看更多\", \"description\": \"我们可以提供从邮件系统选型咨询、搭建部署到后期运维支持的“一站式”解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"反垃圾邮件\", \"urlText\": \"查看更多\", \"description\": \"我们拥有多年邮件系统运维经验，可以提供多种反垃圾邮件解决方案，让您远离垃圾邮件的困扰。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器异地容灾\", \"urlText\": \"查看更多\", \"description\": \"当9·11 事件发生时，我们还可能会认为灾害离我们太远；当举国齐哀的汶川地震发生时，企事业单位数据备份系统容灾能力则面临了前所未有的考验。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器状态监控\", \"urlText\": \"查看更多\", \"description\": \"随着公司业务规模的不断壮大增加，公司在IT方面的投入也成正比例上升，对IT方面的需求也越来越高。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"应用虚拟化\", \"urlText\": \"查看更多\", \"description\": \"所谓应用虚拟化，技术原理是基于应用/服务器计算A/S架构，采用类似虚拟终端的技术所谓应用虚拟化，技术原理是基于应用/服务器计算A/S架构。\"}], \"title\": \"系统集成\", \"number\": 6, \"textbg\": \"3\", \"picture\": \"https://www.linemore.com/images/xtjc.png\", \"subtitle\": \"SYSTEM INTERATION\", \"background\": \"grey\", \"description\": \"蓝盟在充分调研和理解客户需求的基础上，确保客户在业务发展的不同阶段都能获得所需的IT集成解决方案。\"}}, {\"key\": \"page/content/bc4a7e18-4c04-4152-9b19-e15cd5314485\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"网站设计开发\", \"urlText\": \"查看更多\", \"description\": \"我们着眼行业，分析受众，结合互联网＋时代追求良好的浏览体验，专业提供适合用户的网站服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"企业邮箱\", \"urlText\": \"查看更多\", \"description\": \"安全稳定，极速收发，全球畅邮，业界领先\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"超级Excel 开发\", \"urlText\": \"查看更多\", \"description\": \"集成Excel，易学易用，大大降低开发成本与开发周期。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"钉钉定制开发\", \"urlText\": \"查看更多\", \"description\": \"与钉钉是多年的战略合作伙伴，我们对钉钉的产品和解决方案有丰富的实施和服务经验，服务于钉钉产品是蓝盟为用户提供“一站式”信息服务的关键组成部分。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"打印机租赁\", \"urlText\": \"查看更多\", \"description\": \"是施乐、佳能、夏普、惠普等产品代理商，在打印机、复印机等解决方案的实施、维护、维修等方面积累了丰富的经验，同时提供各品牌全系列耗材，提供各品牌设备销售，维修、租赁等服务，为办公室文档输出提供解决方案。\"}], \"title\": \"专项服务\", \"number\": 5, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/images/servcbox4.jpg\", \"subtitle\": \"SPECIAL SERVICE\", \"background\": \"white\", \"description\": \"我们为客户提供域名注册、网站设计开发网站维护、打印机复印机租赁、财务软件咨询、超级Excel定制开发等IT专项服务。\"}}, {\"key\": \"page/content/a404201d-3b21-4d72-b6e3-30cc9ab83497\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"信息安全评估\", \"urlText\": \"查看更多\", \"description\": \"随着技术的发展，各类业务复杂性不断增加导致IT支撑系统复杂度也跟随增加；信息安全建设的思路需要贯彻到IT支撑系统的整个生命周期中。 信息安全考虑内容覆盖面较广，在系统建设时容易出现部分信息安全防护功能缺失,我们需要对系统安全性进行评估。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT流程梳理\", \"urlText\": \"查看更多\", \"description\": \"IT规划，是面向企业业务的 IT战略规划，必然需要考虑业务的运营特点和需求。以往为企业提供IT规划咨询服务时，很多企业都提出，IT规划要满足业务的需求，那就要对业务足够熟 悉，而通过梳理流程能够达到这一步，并且对以后实施系统也有帮助，因此经常要求咨询顾问梳理流程。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT战略规划\", \"urlText\": \"查看更多\", \"description\": \"这首先跟企业的目的有关。是要明晰业务模式，优化业务流程，通过IT系统配合提高；还是要从战略、业务、IT趋势分析IT未来如何建设。两者虽然都要求综合 考虑管理+IT，但前者偏重业务，后者更偏重IT。当企业规模大、业务运营较复杂、IT已经有较好应用基础的企业往往更关注前者。但即使是前者，对业务流 程的梳理也是有个“度”的概念，千万别打着IT规划的旗号，做成流程梳理的项目，这往往也不是企业需要的。而大部分IT规划项目，还是以后者的情况居多。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT资产管理\", \"urlText\": \"查看更多\", \"description\": \"随着IT产业的飞速发展，企业的IT资产的构成日益复杂、各类供应商及品牌日益增加。面对如此复杂的IT资产（台式机、笔记本、服务器、网络设备、软件许可、打印耗材…），您的企业在管理中是否遇到以下困惑？\"}], \"title\": \"咨询服务\", \"number\": 4, \"textbg\": \"3\", \"picture\": \"https://www.linemore.com/images/servcbox6.jpg\", \"subtitle\": \"CONSULTING SERVICES\", \"background\": \"grey\", \"description\": \"当前，对于许多企业而言，由于信息化的不断深化，IT系统的应用规模和应用水平不断提高，企业日常的生产、经营、管理已经开始大规模深度依赖信息系统，因此，信息系统的安全稳定运行就变得异常重要。\"}}]', NULL, NULL, 'ROUTE', 'cn.asany.ui.theme.canvas.Page', NULL);
INSERT INTO `nuwa_component` VALUES (1573, '2021-12-17 21:30:21', NULL, '2021-12-22 14:37:32', 1, '[{\"key\": \"page/hero\", \"props\": {\"component\": \"cn.asany.ui.theme.canvas.PageTitle\"}}, {\"key\": \"page/content\", \"props\": {\"items\": [{\"id\": \"77c8272b-9c14-4b73-a378-a8f035a5ff1c\", \"name\": \"样式二十二\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox22\"}, {\"id\": \"7e882322-5114-431f-91d0-6adee1bf9c62\", \"name\": \"样式二十三\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox23\"}, {\"id\": \"46ffdaad-3807-4594-909f-decef7554d57\", \"name\": \"样式二十三\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox23\"}, {\"id\": \"8ba46697-4ab6-491e-a7ea-7268b04e743f\", \"name\": \"客户 - 网格\", \"component\": \"cn.asany.ui.theme.canvas.ClientsGridLayout\"}]}}, {\"key\": \"page/hero/Carousel\", \"props\": {\"items\": [{\"title\": \"\", \"background\": \"https://www.linemore.com/images/banner8.jpg\", \"description\": \"\"}]}}, {\"key\": \"page/content/77c8272b-9c14-4b73-a378-a8f035a5ff1c\", \"props\": {\"items\": [], \"title\": \"集中IT采购\", \"number\": 5, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/lanmeng/files/image/201803/276365775525731460156556382.jpg\", \"subtitle\": \"\", \"background\": \"white\", \"description\": \"与各品牌厂商都保持着良好的合作关系,从而保证我们的货源质量，到货速度快捷等。 我们可以根据您的需求量，无论定单大小，都会为您提供选型方案，蓝盟承诺三个工作日内提交给您需要的产品解决方案；确认产品及品牌后，立即制定采购方案，客户可根据方案进行市场对比。同等报价，客户可优先选择蓝盟；（如客户选择其它渠道供应商，蓝盟依然提供服务）\\n\\n\"}}, {\"key\": \"page/hero/PageTitle\", \"props\": {\"items\": [{\"url\": \"/\", \"name\": \"首页\"}, {\"name\": \"IT采购\"}], \"title\": \"IT采购\", \"subtitle\": \"\", \"background\": \"https://www.linemore.com/images/banner8.jpg\", \"backgroundOpacity\": 10}}, {\"key\": \"page/content/7e882322-5114-431f-91d0-6adee1bf9c62\", \"props\": {\"items\": [], \"title\": \"服务流程\", \"picture\": \"http://hotsoon-app.oss-cn-hangzhou.aliyuncs.com/website/it-procurement-flow.png\", \"background\": \"grey\", \"description\": \"\"}}, {\"key\": \"page/content/46ffdaad-3807-4594-909f-decef7554d57\", \"props\": {\"items\": [], \"title\": \"服务对比\", \"picture\": \"https://www.linemore.com/files/images/201907/111026209070.jpg\", \"background\": \"white\", \"description\": \"\"}}, {\"key\": \"page/content/8ba46697-4ab6-491e-a7ea-7268b04e743f\", \"props\": {\"items\": [{\"logo\": \"/images/clients/1.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/2.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/3.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/4.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/5.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/6.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/7.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/8.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/9.png\", \"title\": \"标题\"}, {\"logo\": \"/images/clients/10.png\", \"title\": \"标题\"}], \"title\": \"合作品牌\", \"number\": 5, \"subtitle\": \"\", \"background\": \"grey\", \"description\": \"<p>互升连续10年成为微软金牌能力合作伙伴，销售微软全系列产品业绩突出，并得到了微软OFFICE 365华东区域重点扶持，我们从销售、技术培训到产品实施等各环节，可快速部署，并能简单清晰的控制IT产品成本。</p>\\n\\n<p>多年来互升一直是DELL、 HP 、IBM、Cisco、CITRIX以及VMWARE，华为、用友等知名IT厂商的核心经销商，用友金蝶的合作伙伴。互升凭借成熟的技术团队，具备实施部署能力，可为客户提供完善的产品选型和产品咨询等解决方案；</p>\\n\\n<p>互升的集中化采购，每年销售额有近亿元的销售收入；我们与主流厂商有着良好的合作关系，并得到多方面的扶持；包括操作系统、应用服务器、台式机、笔记本、虚拟化、打印机、网络等相关产品；能够快速、可靠地构建满足客户需求的产品解决方案。</p>\"}}]', NULL, NULL, 'ROUTE', 'cn.asany.ui.theme.canvas.Page', NULL);
INSERT INTO `nuwa_component` VALUES (1574, '2021-12-17 21:30:21', NULL, '2021-12-22 01:39:00', 1, '[{\"key\": \"page/hero\", \"props\": {\"component\": \"cn.asany.ui.theme.canvas.Carousel\"}}, {\"key\": \"page/content\", \"props\": {\"items\": [{\"id\": \"62eb7909-2794-490a-9aff-f8ca9a326d3e\", \"name\": \"样式二十二\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox22\"}, {\"id\": \"90dc513b-2936-4198-939a-2c496d38f263\", \"name\": \"样式二十三\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox23\"}, {\"id\": \"44d0ae06-dfc6-4b11-9a58-188fc7186bc5\", \"name\": \"样式二十二\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox22\"}, {\"id\": \"75c44d06-0251-4e2c-9244-bbc10cff9a32\", \"name\": \"博客卡片列表\", \"component\": \"cn.asany.ui.theme.canvas.BlogCards\"}, {\"id\": \"c0cb1917-54cb-4cc5-8e06-15a603ec08f7\", \"name\": \"系统集成\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox22\"}, {\"id\": \"11f904ec-5e7c-4cab-8b7a-c815f7d6daf8\", \"name\": \"IT外包服务\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox14\"}, {\"id\": \"620716a9-ac51-4a1b-b168-3f244a52ff9a\", \"name\": \"应急服务\", \"component\": \"cn.asany.ui.theme.canvas.PromoBox8\"}, {\"id\": \"0a1c4310-5d22-46ca-868a-f8e6bf90c871\", \"name\": \"驻场服务\", \"component\": \"cn.asany.ui.theme.canvas.PromoBox8\"}, {\"id\": \"7aa2cdb0-b9c1-44c9-8e90-c3dd5d72423b\", \"name\": \"网络和服务器服务\", \"component\": \"cn.asany.ui.theme.canvas.PromoBox8\"}, {\"id\": \"2f9b913c-4b36-4392-91e2-10aea831912b\", \"name\": \"3A级远程服务\", \"component\": \"cn.asany.ui.theme.canvas.PromoBox8\"}, {\"id\": \"588ddf04-708d-4304-9c82-0bf079da319f\", \"name\": \"IT采购\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox22\"}, {\"id\": \"bc4a7e18-4c04-4152-9b19-e15cd5314485\", \"name\": \"专项服务\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox22\"}, {\"id\": \"a404201d-3b21-4d72-b6e3-30cc9ab83497\", \"name\": \"咨询服务\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox22\"}]}}, {\"key\": \"page/hero/Carousel\", \"props\": {\"items\": [{\"title\": \"\", \"background\": \"https://www.linemore.com/images/banner-case1.png\", \"description\": \"\"}, {\"title\": \"\", \"background\": \"https://www.linemore.com/images/banner-case3.png\", \"description\": \"说明\"}]}}, {\"key\": \"page/content/62eb7909-2794-490a-9aff-f8ca9a326d3e\", \"props\": {\"items\": [], \"title\": \"弱电工程\", \"number\": 5, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/images/rd.jpg\", \"subtitle\": \"WEAK CURRENT ENGINEERING\", \"background\": \"white\", \"description\": \"深耕18年，我们为1000多家企业客户最身定制弱电智能化咨洵、 规划、设计、施工和运维等一站式解决方案。 拒绝分包，省时省心，品质保障，服务高标准，终身上门，确保企 业客户的信息化系统的安全和稳定的运行。\"}}, {\"key\": \"page/content/44d0ae06-dfc6-4b11-9a58-188fc7186bc5\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"综合布线\", \"urlText\": \"查看更多\", \"description\": \"综合布线 在新办公室装修、老办公室机房整理时，您需要专业团队提供定制化的方案、实惠的价格及标准化施工，蓝盟帮您全部搞定。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"机房建设\", \"urlText\": \"查看更多\", \"description\": \"蓝盟团队集建筑、电气、机电安装、网络构建等多个专业技术于一体，拥有丰富的工程实施和管理经验。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"门禁考勤\", \"urlText\": \"查看更多\", \"description\": \"门禁考勤系统可以提供人员进出、授权、查询、统计和防盗报警保安等功能，也可作为人事管理、考勤管理工具，是现代企业必备的IT系统。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"防盗报警系统\", \"urlText\": \"查看更多\", \"description\": \"设备一般分为：前端探测器，报警控制器。报警控制器是一台主机（如电脑的主机一样）\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"视频监控\", \"urlText\": \"查看更多\", \"description\": \"互动聚集了十余年行业从业经验的方案设计专家，为您量身打造精准、专业、智能的监控解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"电话交换机\", \"urlText\": \"查看更多\", \"description\": \"根据客户的业务特点，蓝盟团队为您提供专业的PBX和VOIP电话解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"多媒体会议室\", \"urlText\": \"查看更多\", \"description\": \"多媒体会议室集成了语音会议、视频会议、显示、广播、环境控制、电子白板、预约及会议系统，需要专业团队提供方案规划、设计、实施和维护。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"视频会议\", \"urlText\": \"查看更多\", \"description\": \"软件或硬件的方式，实现两个或两个以上不同地点的沟通需求，互升已经为数百家企业实施了视频会议系统。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"一卡通\", \"urlText\": \"查看更多\", \"description\": \"可在同一张智能卡上实现、门禁、考勤、消费、巡更、访客管理、电梯控制等综合管理功能。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"拼接屏\", \"urlText\": \"查看更多\", \"description\": \"拼接屏是一个完整的液晶拼接显示单元，根据不同使用需求，实现单屏单独显示、任意组合显示、全屏液晶拼接、竖屏显示等不同内容展示需求。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"电话会议\", \"urlText\": \"查看更多\", \"description\": \"软件或硬件的方式，实现两个或两个以上不同地点的沟通需求，蓝盟已经为数百家企业实施了电话会议系统。\"}], \"title\": \"服务项目\", \"number\": 6, \"textbg\": \"1\", \"subtitle\": \"\", \"background\": \"grey\", \"description\": \"\"}}, {\"key\": \"page/content/90dc513b-2936-4198-939a-2c496d38f263\", \"props\": {\"items\": [], \"title\": \"服务流程\", \"picture\": \"https://www.linemore.com/images/case-fuwu1.png\", \"background\": \"white\", \"description\": \"\"}}, {\"key\": \"page/content/75c44d06-0251-4e2c-9244-bbc10cff9a32\", \"props\": {\"title\": \"项目案例\", \"channel\": \"cases\", \"background\": \"white\"}}, {\"key\": \"page/content/c0cb1917-54cb-4cc5-8e06-15a603ec08f7\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"网络改造\", \"urlText\": \"查看更多\", \"description\": \"我们为客户提供网络环境重新搭建、设备升级等项目实施，为业务系统健康运行提供保障。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"无线覆盖\", \"urlText\": \"查看更多\", \"description\": \"我们提供企业级无线覆盖解决方案，确保无线网络不再出现掉线、不稳定等故障。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"病毒防护\", \"urlText\": \"查看更多\", \"description\": \"通过部署企业防病毒系统，使您远离病毒侵扰。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"访问控制\", \"urlText\": \"查看更多\", \"description\": \"通过对用户的身份进行认证，控制用户对服务器、目录、文件等网络资源的访问权限。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"上网行为管理\", \"urlText\": \"查看更多\", \"description\": \"帮您实现访问网页内容过滤、网络应用访问控制、带宽流量管理、信息收发审计、员工上网行为审计和分析。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"桌面虚拟化\", \"urlText\": \"查看更多\", \"description\": \"将计算机的终端系统进行虚拟化，以达到桌面使用的安全性和灵活性。可以通过任何设备，在任何地点，任何时间通过网络访问属于员工个人的桌面系统。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器虚拟化\", \"urlText\": \"查看更多\", \"description\": \"通过服务器虚拟化，可以动态管理的服务器硬件资源，提高资源利用率，简化系统管理，实现服务器整合。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器负载均衡\", \"urlText\": \"查看更多\", \"description\": \"为了解决大量的网站或应用访问，通过配置服务器环境的负载均衡，将各种服务请求均衡分配到实际执行的服务中去，从而保证整个系统的响应速度。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器托管\", \"urlText\": \"查看更多\", \"description\": \"拥有丰富的IDC资源，可以为您提供丰富的线路资源和一站式的管理服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"数据文件共享\", \"urlText\": \"查看更多\", \"description\": \"每家公司都有数据文件共享的需求，通过合理地设置共享目录和员工访问权限，可以提升工作效率、有效控制泄密事件的产生。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"数据备份\", \"urlText\": \"查看更多\", \"description\": \"根据客户的实际需求，我们提供灵活、安全的数据备份方案，确保企业核心数据的安全。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"数据加密\", \"urlText\": \"查看更多\", \"description\": \"每家企业的研发、设计、运营数据都属于核心机密，通过部署数据加密系统可以避免因机密数据泄露而导致的巨额损失。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"邮件服务器\", \"urlText\": \"查看更多\", \"description\": \"我们可以提供从邮件系统选型咨询、搭建部署到后期运维支持的“一站式”解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"反垃圾邮件\", \"urlText\": \"查看更多\", \"description\": \"我们拥有多年邮件系统运维经验，可以提供多种反垃圾邮件解决方案，让您远离垃圾邮件的困扰。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器异地容灾\", \"urlText\": \"查看更多\", \"description\": \"当9·11 事件发生时，我们还可能会认为灾害离我们太远；当举国齐哀的汶川地震发生时，企事业单位数据备份系统容灾能力则面临了前所未有的考验。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器状态监控\", \"urlText\": \"查看更多\", \"description\": \"随着公司业务规模的不断壮大增加，公司在IT方面的投入也成正比例上升，对IT方面的需求也越来越高。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"应用虚拟化\", \"urlText\": \"查看更多\", \"description\": \"所谓应用虚拟化，技术原理是基于应用/服务器计算A/S架构，采用类似虚拟终端的技术所谓应用虚拟化，技术原理是基于应用/服务器计算A/S架构。\"}], \"title\": \"系统集成\", \"number\": 6, \"textbg\": \"3\", \"picture\": \"https://www.linemore.com/images/xtjc.png\", \"subtitle\": \"SYSTEM INTERATION\", \"background\": \"grey\", \"description\": \"蓝盟在充分调研和理解客户需求的基础上，确保客户在业务发展的不同阶段都能获得所需的IT集成解决方案。\"}}, {\"key\": \"page/content/11f904ec-5e7c-4cab-8b7a-c815f7d6daf8\", \"props\": {\"image\": \"https://www.linemore.com/images/b1.jpg\", \"items\": [{\"icon\": \"icon-line-help\", \"title\": \"应急服务\"}, {\"icon\": \"icon-line-help\", \"title\": \"驻场服务\"}, {\"icon\": \"icon-line-help\", \"title\": \"网络和服务器服务\"}, {\"icon\": \"icon-line-help\", \"title\": \"3A级远程服务\"}], \"style\": \"one\", \"title\": \"<span>IT外包</span>服务\", \"background\": \"white\", \"description\": \"致力于让用户的IT更简单、更高效、更安全、更有价值\"}}, {\"key\": \"page/content/620716a9-ac51-4a1b-b168-3f244a52ff9a\", \"props\": {\"url\": \"\", \"icon\": \"icon-spa\", \"image\": \"https://www.linemore.com/images/hai.png\", \"style\": \"one\", \"title\": \"应急服务\", \"slogan\": \"随叫随到\", \"content\": [{\"icon\": \"icon-signal\", \"title\": \"专属服务团队提供服务\"}, {\"icon\": \"icon-sign-in-alt\", \"title\": \"人员稳定，拒绝陌生面孔服务\"}, {\"icon\": \"icon-sign\", \"title\": \"可灵活选择，5×8×2服务、5×8×4服务、7×24×2服务\"}, {\"icon\": \"icon-line-server\", \"title\": \"电脑台数在50台以内的企业\"}], \"urlText\": \"查看更多\", \"emphasis\": [\"5分钟响应\", \"2小时到场服务\", \"50-200元迟到按次罚款\"], \"background\": \"white\", \"description\": \"适用于电脑台数量50台以内的企业。这种服务方式优点是方便、灵活、随叫随到, 5分钟响应、2小时内到场服务。迟到，按次罚款。\"}}, {\"key\": \"page/content/0a1c4310-5d22-46ca-868a-f8e6bf90c871\", \"props\": {\"url\": \"\", \"icon\": \"icon-spa\", \"image\": \"https://www.linemore.com/images/hai2.png\", \"style\": \"two\", \"title\": \"驻场服务\", \"slogan\": \"随需而用\", \"content\": [{\"icon\": \"icon-line-send\", \"title\": \"专属服务团队提供服务\"}, {\"icon\": \"icon-line-send\", \"title\": \"方式灵活，提供每周5天、3天、2天或1天的固定工程师，按照客户作息时间提供常驻服务\"}, {\"icon\": \"icon-line-send\", \"title\": \"\\t电脑规模50台以上或IT工作量集中的企业\"}], \"urlText\": \"查看更多\", \"emphasis\": [\"稳定\", \"经验丰富\", \" 服务+巡检\", \"全方位分析\"], \"background\": \"background\", \"description\": \"适用于电脑数量50台以上，或对IT依赖性比较高，或IT工作量比较集中的企业。我们的固定工程师可以每周5天、3天、2天、1天按照客户作息时间常驻服务。\", \"hideBottomLine\": false}}, {\"key\": \"page/content/7aa2cdb0-b9c1-44c9-8e90-c3dd5d72423b\", \"props\": {\"url\": \"\", \"icon\": \"icon-spa\", \"image\": \"https://www.linemore.com/images/hai3.png\", \"style\": \"one\", \"title\": \"网络和服务器服务\", \"slogan\": \"主动预防\", \"content\": [{\"icon\": \"icon-line-stop-circle\", \"title\": \"专属服务团队提供服务\"}, {\"icon\": \"icon-line-thermometer\", \"title\": \"专业团队提供核心服务器、网络设备、安全系统的咨询、巡检和运维服务\"}, {\"icon\": \"icon-line-star\", \"title\": \"方式灵活，定期工程师现场巡检\"}], \"urlText\": \"查看更多\", \"emphasis\": [\"合理规划\", \"安全性\", \"稳定性\"], \"background\": \"background\", \"description\": \"我们的团队提供核心服务器、网络设备、系统安全的咨询、巡检和运维等“一站式”服务。\", \"hideBottomLine\": false}}, {\"key\": \"page/content/2f9b913c-4b36-4392-91e2-10aea831912b\", \"props\": {\"url\": \"\", \"icon\": \"icon-window\", \"image\": \"https://www.linemore.com/images/hai4.png\", \"style\": \"two\", \"title\": \"3A级远程服务\", \"slogan\": \"时刻在线\", \"content\": [{\"icon\": \"icon-email2\", \"title\": \"时刻在线、5分钟响应\"}, {\"icon\": \"icon-users1\", \"title\": \"远程服务次数不限次，按需上门\"}, {\"icon\": \"icon-share1\", \"title\": \"专属服务团队，精准定位问题\"}, {\"icon\": \"icon-paperclip1\", \"title\": \"标准化服务流程，保证服务质量\"}], \"urlText\": \"查看更多\", \"emphasis\": [\"快速\", \"安全\", \"稳定\"], \"background\": \"background\", \"description\": \"此服务适用于用户的电脑数量10台内或者移动办公人员多，地域分散或需要支持的次数少，响应要求却很高的企业。\", \"hideBottomLine\": true}}, {\"key\": \"page/content/588ddf04-708d-4304-9c82-0bf079da319f\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"产品选型\", \"urlText\": \"查看更多\", \"description\": \"参照您的需求，我们从海量的IT产品中为您挑选具有较高性价比的采购方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务流程\", \"urlText\": \"查看更多\", \"description\": \"严格标准化的流程，确保您能可以从蓝盟获得具有竞争力的采购服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"互升优势\", \"urlText\": \"查看更多\", \"description\": \"选型、支付、报修和保外服务，处处体现着互升的用心服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"品牌合作\", \"urlText\": \"查看更多\", \"description\": \"覆盖中小企业需求的全品类IT产品合作渠道。\"}], \"title\": \"IT采购\", \"number\": 4, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/images/IT.png\", \"subtitle\": \"CENTRALIZED IT PROCUREMENT\", \"background\": \"grey\", \"description\": \"<ul class=\\\"servcriul por\\\">                     <li>您可能面临的问题：</li>                     <li>采购需求零散，品类不多，涉及面广，选型咨询难！获得多供应商支持的难度大，成本高！多方采购导致单位成本升高，企业自身的议价难度大！</li>                 </ul>\"}}, {\"key\": \"page/content/bc4a7e18-4c04-4152-9b19-e15cd5314485\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"网站设计开发\", \"urlText\": \"查看更多\", \"description\": \"我们着眼行业，分析受众，结合互联网＋时代追求良好的浏览体验，专业提供适合用户的网站服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"企业邮箱\", \"urlText\": \"查看更多\", \"description\": \"安全稳定，极速收发，全球畅邮，业界领先\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"超级Excel 开发\", \"urlText\": \"查看更多\", \"description\": \"集成Excel，易学易用，大大降低开发成本与开发周期。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"钉钉定制开发\", \"urlText\": \"查看更多\", \"description\": \"与钉钉是多年的战略合作伙伴，我们对钉钉的产品和解决方案有丰富的实施和服务经验，服务于钉钉产品是蓝盟为用户提供“一站式”信息服务的关键组成部分。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"打印机租赁\", \"urlText\": \"查看更多\", \"description\": \"是施乐、佳能、夏普、惠普等产品代理商，在打印机、复印机等解决方案的实施、维护、维修等方面积累了丰富的经验，同时提供各品牌全系列耗材，提供各品牌设备销售，维修、租赁等服务，为办公室文档输出提供解决方案。\"}], \"title\": \"专项服务\", \"number\": 5, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/images/servcbox4.jpg\", \"subtitle\": \"SPECIAL SERVICE\", \"background\": \"white\", \"description\": \"我们为客户提供域名注册、网站设计开发网站维护、打印机复印机租赁、财务软件咨询、超级Excel定制开发等IT专项服务。\"}}, {\"key\": \"page/content/a404201d-3b21-4d72-b6e3-30cc9ab83497\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"信息安全评估\", \"urlText\": \"查看更多\", \"description\": \"随着技术的发展，各类业务复杂性不断增加导致IT支撑系统复杂度也跟随增加；信息安全建设的思路需要贯彻到IT支撑系统的整个生命周期中。 信息安全考虑内容覆盖面较广，在系统建设时容易出现部分信息安全防护功能缺失,我们需要对系统安全性进行评估。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT流程梳理\", \"urlText\": \"查看更多\", \"description\": \"IT规划，是面向企业业务的 IT战略规划，必然需要考虑业务的运营特点和需求。以往为企业提供IT规划咨询服务时，很多企业都提出，IT规划要满足业务的需求，那就要对业务足够熟 悉，而通过梳理流程能够达到这一步，并且对以后实施系统也有帮助，因此经常要求咨询顾问梳理流程。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT战略规划\", \"urlText\": \"查看更多\", \"description\": \"这首先跟企业的目的有关。是要明晰业务模式，优化业务流程，通过IT系统配合提高；还是要从战略、业务、IT趋势分析IT未来如何建设。两者虽然都要求综合 考虑管理+IT，但前者偏重业务，后者更偏重IT。当企业规模大、业务运营较复杂、IT已经有较好应用基础的企业往往更关注前者。但即使是前者，对业务流 程的梳理也是有个“度”的概念，千万别打着IT规划的旗号，做成流程梳理的项目，这往往也不是企业需要的。而大部分IT规划项目，还是以后者的情况居多。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT资产管理\", \"urlText\": \"查看更多\", \"description\": \"随着IT产业的飞速发展，企业的IT资产的构成日益复杂、各类供应商及品牌日益增加。面对如此复杂的IT资产（台式机、笔记本、服务器、网络设备、软件许可、打印耗材…），您的企业在管理中是否遇到以下困惑？\"}], \"title\": \"咨询服务\", \"number\": 4, \"textbg\": \"3\", \"picture\": \"https://www.linemore.com/images/servcbox6.jpg\", \"subtitle\": \"CONSULTING SERVICES\", \"background\": \"grey\", \"description\": \"当前，对于许多企业而言，由于信息化的不断深化，IT系统的应用规模和应用水平不断提高，企业日常的生产、经营、管理已经开始大规模深度依赖信息系统，因此，信息系统的安全稳定运行就变得异常重要。\"}}]', NULL, NULL, 'ROUTE', 'cn.asany.ui.theme.canvas.Page', NULL);
