持的难度大，成本高！多方采购导致单位成本升高，企业自身的议价难度大！</li>                 </ul>\"}}, {\"key\": \"page/content/8d4b148f-7d67-42d5-a6af-8c42dffee40f\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"综合布线\", \"urlText\": \"查看更多\", \"description\": \"综合布线 在新办公室装修、老办公室机房整理时，您需要专业团队提供定制化的方案、实惠的价格及标准化施工，蓝盟帮您全部搞定。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"机房建设\", \"urlText\": \"查看更多\", \"description\": \"蓝盟团队集建筑、电气、机电安装、网络构建等多个专业技术于一体，拥有丰富的工程实施和管理经验。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"门禁考勤\", \"urlText\": \"查看更多\", \"description\": \"门禁考勤系统可以提供人员进出、授权、查询、统计和防盗报警保安等功能，也可作为人事管理、考勤管理工具，是现代企业必备的IT系统。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"防盗报警系统\", \"urlText\": \"查看更多\", \"description\": \"设备一般分为：前端探测器，报警控制器。报警控制器是一台主机（如电脑的主机一样）\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"视频监控\", \"urlText\": \"查看更多\", \"description\": \"聚集了十余年行业从业经验的方案设计专家，为您量身打造精准、专业、智能的监控解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"电话交换机\", \"urlText\": \"查看更多\", \"description\": \"根据客户的业务特点，蓝盟团队为您提供专业的PBX和VOIP电话解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"多媒体会议室\", \"urlText\": \"查看更多\", \"description\": \"多媒体会议室集成了语音会议、视频会议、显示、广播、环境控制、电子白板、预约及会议系统，需要专业团队提供方案规划、设计、实施和维护。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"视频会议\", \"urlText\": \"查看更多\", \"description\": \"软件或硬件的方式，实现两个或两个以上不同地点的沟通需求，蓝盟已经为数百家企业实施了视频会议系统。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"一卡通\", \"urlText\": \"查看更多\", \"description\": \"可在同一张智能卡上实现、门禁、考勤、消费、巡更、访客管理、电梯控制等综合管理功能。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"拼接屏\", \"urlText\": \"查看更多\", \"description\": \"拼接屏是一个完整的液晶拼接显示单元，根据不同使用需求，实现单屏单独显示、任意组合显示、全屏液晶拼接、竖屏显示等不同内容展示需求。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"电话会议\", \"urlText\": \"查看更多\", \"description\": \"软件或硬件的方式，实现两个或两个以上不同地点的沟通需求，蓝盟已经为数百家企业实施了电话会议系统。\"}], \"title\": \"弱电工程\", \"number\": 6, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/images/rdgc.png\", \"subtitle\": \"WEAK CURRENT ENGINEERING\", \"background\": \"grey\", \"description\": \"弱电系统是企业IT系统的基础，也是企业管理的重要工具。蓝盟为客户量身定制\\n弱电智能化方案，严谨施工，并提供高于行业标准的维保服务。\"}}, {\"key\": \"page/content/c0cb1917-54cb-4cc5-8e06-15a603ec08f7\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"网络改造\", \"urlText\": \"查看更多\", \"description\": \"我们为客户提供网络环境重新搭建、设备升级等项目实施，为业务系统健康运行提供保障。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"无线覆盖\", \"urlText\": \"查看更多\", \"description\": \"我们提供企业级无线覆盖解决方案，确保无线网络不再出现掉线、不稳定等故障。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"病毒防护\", \"urlText\": \"查看更多\", \"description\": \"通过部署企业防病毒系统，使您远离病毒侵扰。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"访问控制\", \"urlText\": \"查看更多\", \"description\": \"通过对用户的身份进行认证，控制用户对服务器、目录、文件等网络资源的访问权限。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"上网行为管理\", \"urlText\": \"查看更多\", \"description\": \"帮您实现访问网页内容过滤、网络应用访问控制、带宽流量管理、信息收发审计、员工上网行为审计和分析。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"桌面虚拟化\", \"urlText\": \"查看更多\", \"description\": \"将计算机的终端系统进行虚拟化，以达到桌面使用的安全性和灵活性。可以通过任何设备，在任何地点，任何时间通过网络访问属于员工个人的桌面系统。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器虚拟化\", \"urlText\": \"查看更多\", \"description\": \"通过服务器虚拟化，可以动态管理的服务器硬件资源，提高资源利用率，简化系统管理，实现服务器整合。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器负载均衡\", \"urlText\": \"查看更多\", \"description\": \"为了解决大量的网站或应用访问，通过配置服务器环境的负载均衡，将各种服务请求均衡分配到实际执行的服务中去，从而保证整个系统的响应速度。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器托管\", \"urlText\": \"查看更多\", \"description\": \"拥有丰富的IDC资源，可以为您提供丰富的线路资源和一站式的管理服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"数据文件共享\", \"urlText\": \"查看更多\", \"description\": \"每家公司都有数据文件共享的需求，通过合理地设置共享目录和员工访问权限，可以提升工作效率、有效控制泄密事件的产生。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"数据备份\", \"urlText\": \"查看更多\", \"description\": \"根据客户的实际需求，我们提供灵活、安全的数据备份方案，确保企业核心数据的安全。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"数据加密\", \"urlText\": \"查看更多\", \"description\": \"每家企业的研发、设计、运营数据都属于核心机密，通过部署数据加密系统可以避免因机密数据泄露而导致的巨额损失。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"邮件服务器\", \"urlText\": \"查看更多\", \"description\": \"我们可以提供从邮件系统选型咨询、搭建部署到后期运维支持的“一站式”解决方案。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"反垃圾邮件\", \"urlText\": \"查看更多\", \"description\": \"我们拥有多年邮件系统运维经验，可以提供多种反垃圾邮件解决方案，让您远离垃圾邮件的困扰。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器异地容灾\", \"urlText\": \"查看更多\", \"description\": \"当9·11 事件发生时，我们还可能会认为灾害离我们太远；当举国齐哀的汶川地震发生时，企事业单位数据备份系统容灾能力则面临了前所未有的考验。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"服务器状态监控\", \"urlText\": \"查看更多\", \"description\": \"随着公司业务规模的不断壮大增加，公司在IT方面的投入也成正比例上升，对IT方面的需求也越来越高。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"应用虚拟化\", \"urlText\": \"查看更多\", \"description\": \"所谓应用虚拟化，技术原理是基于应用/服务器计算A/S架构，采用类似虚拟终端的技术所谓应用虚拟化，技术原理是基于应用/服务器计算A/S架构。\"}], \"title\": \"系统集成\", \"number\": 6, \"textbg\": \"3\", \"picture\": \"https://www.linemore.com/images/xtjc.png\", \"subtitle\": \"SYSTEM INTERATION\", \"background\": \"white\", \"description\": \"蓝盟在充分调研和理解客户需求的基础上，确保客户在业务发展的不同阶段都能获得所需的IT集成解决方案。\"}}, {\"key\": \"page/content/bc4a7e18-4c04-4152-9b19-e15cd5314485\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"网站设计开发\", \"urlText\": \"查看更多\", \"description\": \"我们着眼行业，分析受众，结合互联网＋时代追求良好的浏览体验，专业提供适合用户的网站服务。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"企业邮箱\", \"urlText\": \"查看更多\", \"description\": \"安全稳定，极速收发，全球畅邮，业界领先\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"超级Excel 开发\", \"urlText\": \"查看更多\", \"description\": \"集成Excel，易学易用，大大降低开发成本与开发周期。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"钉钉定制开发\", \"urlText\": \"查看更多\", \"description\": \"与钉钉是多年的战略合作伙伴，我们对钉钉的产品和解决方案有丰富的实施和服务经验，服务于钉钉产品是蓝盟为用户提供“一站式”信息服务的关键组成部分。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"打印机租赁\", \"urlText\": \"查看更多\", \"description\": \"是施乐、佳能、夏普、惠普等产品代理商，在打印机、复印机等解决方案的实施、维护、维修等方面积累了丰富的经验，同时提供各品牌全系列耗材，提供各品牌设备销售，维修、租赁等服务，为办公室文档输出提供解决方案。\"}], \"title\": \"专项服务\", \"number\": 5, \"textbg\": \"1\", \"picture\": \"https://www.linemore.com/images/servcbox4.jpg\", \"subtitle\": \"SPECIAL SERVICE\", \"background\": \"white\", \"description\": \"我们为客户提供域名注册、网站设计开发网站维护、打印机复印机租赁、财务软件咨询、超级Excel定制开发等IT专项服务。\"}}, {\"key\": \"page/content/a404201d-3b21-4d72-b6e3-30cc9ab83497\", \"props\": {\"items\": [{\"icon\": \"icon-line-sunrise\", \"title\": \"信息安全评估\", \"urlText\": \"查看更多\", \"description\": \"随着技术的发展，各类业务复杂性不断增加导致IT支撑系统复杂度也跟随增加；信息安全建设的思路需要贯彻到IT支撑系统的整个生命周期中。 信息安全考虑内容覆盖面较广，在系统建设时容易出现部分信息安全防护功能缺失,我们需要对系统安全性进行评估。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT流程梳理\", \"urlText\": \"查看更多\", \"description\": \"IT规划，是面向企业业务的 IT战略规划，必然需要考虑业务的运营特点和需求。以往为企业提供IT规划咨询服务时，很多企业都提出，IT规划要满足业务的需求，那就要对业务足够熟 悉，而通过梳理流程能够达到这一步，并且对以后实施系统也有帮助，因此经常要求咨询顾问梳理流程。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT战略规划\", \"urlText\": \"查看更多\", \"description\": \"这首先跟企业的目的有关。是要明晰业务模式，优化业务流程，通过IT系统配合提高；还是要从战略、业务、IT趋势分析IT未来如何建设。两者虽然都要求综合 考虑管理+IT，但前者偏重业务，后者更偏重IT。当企业规模大、业务运营较复杂、IT已经有较好应用基础的企业往往更关注前者。但即使是前者，对业务流 程的梳理也是有个“度”的概念，千万别打着IT规划的旗号，做成流程梳理的项目，这往往也不是企业需要的。而大部分IT规划项目，还是以后者的情况居多。\"}, {\"icon\": \"icon-line-sunrise\", \"title\": \"IT资产管理\", \"urlText\": \"查看更多\", \"description\": \"随着IT产业的飞速发展，企业的IT资产的构成日益复杂、各类供应商及品牌日益增加。面对如此复杂的IT资产（台式机、笔记本、服务器、网络设备、软件许可、打印耗材…），您的企业在管理中是否遇到以下困惑？\"}], \"title\": \"咨询服务\", \"number\": 4, \"textbg\": \"3\", \"picture\": \"https://www.linemore.com/images/servcbox6.jpg\", \"subtitle\": \"CONSULTING SERVICES\", \"background\": \"grey\", \"description\": \"当前，对于许多企业而言，由于信息化的不断深化，IT系统的应用规模和应用水平不断提高，企业日常的生产、经营、管理已经开始大规模深度依赖信息系统，因此，信息系统的安全稳定运行就变得异常重要。\"}}]', NULL, NULL, 'ROUTE', 'cn.asany.ui.theme.canvas.Page', NULL);
INSERT INTO `nuwa_component` VALUES (1576, '2021-12-17 21:30:22', NULL, '2021-12-22 21:24:09', 1, '[{\"key\": \"page/hero\", \"props\": {\"component\": \"cn.asany.ui.theme.canvas.PageTitle\"}}, {\"key\": \"page/content\", \"props\": {\"items\": [{\"id\": \"02dd17d6-8f03-48c9-8569-6d3805b90377\", \"name\": \"关于我们\", \"component\": \"cn.asany.ui.theme.canvas.About\"}, {\"id\": \"9ba9a41c-3c06-4f9c-8715-9498e4c724b4\", \"name\": \"大事记\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox23\"}, {\"id\": \"a0f25889-213b-4ffd-a03c-4a2ed13e8c47\", \"name\": \"资质荣誉\", \"component\": \"cn.asany.ui.theme.canvas.FeaturedBox19\"}, {\"id\": \"ea68da72-37a9-4915-b809-795b07284ba5\", \"name\": \" 团队（列表）\", \"component\": \"cn.asany.ui.theme.canvas.TeamListLayout\"}]}}, {\"key\": \"page/hero/PageTitle\", \"props\": {\"items\": [{\"url\": \"/\", \"name\": \"首页\"}, {\"name\": \"关于\"}], \"title\": \"关于\", \"backgroundOpacity\": 10}}, {\"key\": \"page/content/02dd17d6-8f03-48c9-8569-6d3805b90377\", \"props\": {\"title\": \"关于互升\", \"subtitle\": \"ABOUT US\", \"background\": \"white\", \"description\": \"<ul class=\\\"aboul colo6 list-paddingleft-2\\\">\\n  <li>\\n  <p>互升于2002年成立于上海，致力于为企业客户提供IT外包、IT采购、弱电工程、系统集成、网络安全、微软云（Azure、Office365）、阿里云、腾讯云、打印机租赁等“一站式”信息服务解决方案。</p>\\n  </li>\\n  <li>\\n  <p>我们慧聚了一大批有着IT理想的年轻人，他们有的来自复旦、同济、交大等名校；有的来自IBM、HP、Dell、lenovo等知名公司；他们可以提供英语、日语等多语言支持。</p>\\n  </li>\\n  <li>\\n  <p>我们拥有稳步增长的“伙伴式”服务客户，员工拥有CCIE、CISSP、MCSE、CIW、RHCE 、PMP、Itil、ITSS等丰富的认证资质，最重要的是，互升为员工提供了良好的职业发展空间。</p>\\n  </li>\\n  <li>\\n  <p>我们是荣获“上海市质量金奖”的IT外包服务商，连续10年获得微软金牌合作伙伴资质，连续10年获得上海市高新技术企业认定，连续10年获得“守合同重信用单位”认定，连续10年获评“合同信用等级AAA级”，上海专精特新企业等资质。先后通过了ISO9001:2008、ISO20000、ISO27001质量体系认证，2017年成为Oracle金牌合作伙伴，阿里云城市服务商合作伙伴，网易企业服务核心合作伙伴。</p>\\n  </li>\\n  <li>\\n  <p>我们拥有18+年行业经验、500+专职工程师、保持了18年无安全事件的行业纪录，1000+ 客户遍布金融、生物医疗、能源化工、服装纺织、房地产、创意设计、广告传媒、零售贸易、政府等数十个行业。</p>\\n  </li>\\n  <li>\\n  <p>我们相继在北京、广州、深圳、杭州设立运营中心，在全国32个主要城市、纽约、香港、台北设立办事处，在实现技术能力全覆盖的同时，扩大地域覆盖能力。</p>\\n  </li>\\n  <li>\\n  <p>我们践行服务承诺、严控服务质量，期待越来越多的客户体验互升的“精致化”信息服务！</p>\\n  </li>\\n</ul>\"}}, {\"key\": \"page/content/9ba9a41c-3c06-4f9c-8715-9498e4c724b4\", \"props\": {\"items\": [], \"title\": \"大事记\", \"picture\": \"https://media.slidesgo.com/storage/158442/responsive-images/0-timeline-infographics___media_library_original_1600_900.jpg\", \"background\": \"grey\", \"description\": \"BIG EVENTS\"}}, {\"key\": \"page/content/a0f25889-213b-4ffd-a03c-4a2ed13e8c47\", \"props\": {\"items\": [{\"image\": \"https://www.linemore.com/files/images/201912/1203032518370.png\", \"title\": \"上海市质量金奖\"}, {\"image\": \"https://www.linemore.com/files/images/202111/1405041567240.jpg\", \"title\": \"上海市质量标杆\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1202580240240.png\", \"title\": \"上海高新技术企业\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1202581099620.png\", \"title\": \"合同信用等级AAA级\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1202581832430.png\", \"title\": \"上海市守重企业\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1202582746490.png\", \"title\": \"劳动关系和谐示范单位\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1202585302740.png\", \"title\": \"最佳IT桌面外包服务奖\"}], \"title\": \"资质荣誉\", \"background\": \"white\", \"qualifications\": [{\"image\": \"https://www.linemore.com/files/images/202006/2305144134620.png\", \"title\": \"微软金牌合作伙伴\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1203143958990.png\", \"title\": \"复旦创业企业展评\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1203242963680.png\", \"title\": \"“专精特新”企业\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1203254466810.png\", \"title\": \"ISO27001安全认证\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1203381451180.png\", \"title\": \"ISO9001体系认证\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1203440477740.png\", \"title\": \"阿里云合作伙伴\"}, {\"image\": \"https://www.linemore.com/files/images/201912/1203475349620.